package dailyPractice;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class codeSignal_1 {
    public static void main(String[] args) {
        codeSignal_1 test = new codeSignal_1();
        String s ="";
        String p ="";
//        String s = "aaaaaaaaaa";
//        String p = "aaaaa";
        System.out.println(test.findAnagram(s, p));

    }
    public List<Integer> findAnagram (String s, String p) {
        Map<Character, Integer> map = new HashMap<>();
        Map<Character, Integer> win = new HashMap<>();
        System.out.println(s.length());
        System.out.println(p.length());
        for (int i = 0; i < p.length(); i++) {
            map.put(p.charAt(i), map.getOrDefault(p.charAt(i), 0) + 1);
        }

        System.out.println("init map " + map);

        List<Integer> res = new ArrayList<>();
        int l = 0, r = 0;
        long count = 0;
        while (r < s.length()) {
            char t = s.charAt(r);
            r++;
            win.put(t, win.getOrDefault(t, 0) + 1);
            //if (r == 10000) System.out.println(t);

            if (map.containsKey(t)) {
                if (r == 10000)
                    System.out.println(win.get(t) == map.get(t));
                // if (r == 10000) {
                //     System.out.println((int)win.get(t) == (int)map.get(t));
                //     System.out.println("win"+ win + "...." + win.get(t));
                //     System.out.println("map"+ map + "...." + map.get(t));
                // }
                int a = win.get(t);
                int b = map.get(t);
                System.out.println(win.get(t).hashCode() == map.get(t).hashCode());
                if (a == b) {
                    //System.out.println("r=" + r);
                    count++;
                }
            }
            // System.out.print(l);
            // System.out.print(r);
            // System.out.println();
            if (r - l == p.length()) {
//                if (r == 10000) {
//                    System.out.println("count=" + count);
//                    System.out.println(map);
//                    System.out.println(win);
//                }
                if (count == map.size()) {
                    res.add(l);
                }
                char c = s.charAt(l);
                l++;
                if (map.containsKey(c)) {
                    if (win.get(c) == map.get(c)) {
                        count--;
                    }
                    win.put(c, win.getOrDefault(c, 0) - 1);
                }

            }
        }
        return res;
    }
}
